def make_change_dyn(x, coins):
    best = np.zeros(x+1)
    choices = np.zeros(x+1)

    for i in range(x+1):
        best[i] = i
        choices[i] = i
    ## Bottom up approach
    for i in range(1, x+1):
        for c in coins:
            if c <= i:
                sol = 1 + best[i-c]
                if sol < best[i]:
                    best = sol
